D1 = 'Job description Overview Our rapidly scaling medical education technology company is seeking a passionate Data Analyst to join our team. In this role, you will be working with the product, marketing, content, and operations teams to help us build the most joyful, effective learning platform in the medical education space. This is a hands-on position in a unique remote, start-up environment, so we are looking for a candidate who is not afraid to roll up their sleeves to do the work and to collaborate with team members across the organization. About Osmosis Our mission is to “ Empower the world’s clinicians & caregivers with the best learning experience possible.” To this end, we have an audience of more than a million current & future clinicians as well as patients and family members. Our members of the Osmosis learning platform and video library use the product to learn efficiently & excel in classes, board exams, and in the clinic. We are a team of creative, approachable, and driven entrepreneurs, researchers, and clinicians who are passionate about improving healthcare and education. At Osmosis, we collaborate remotely and value highly-motivated problem solvers who manage their time efficiently, communicate earnestly, work effectively, and understand the importance of life-work balance. We do everything we can to make sure our teammates are successful personally and professionally. About the Role As a Data Analyst, you will turn data into information, information into insight and insight into business decisions. You’ll develop analysis and reporting capabilities as well as monitor performance and quality control plans to identify improvements. Your primary responsibility will be to work with stakeholders across business functions including product, growth, marketing, and operations to build analytics products that enable data-driven decision making. You will guide analytics projects from discovery to solution and help us raise the bar for how we should apply our data to business decisions. In this role, you will be expected to: Complete analysis projects with business stakeholders to monitor the health of the business and help the business make data-driven strategic, product, and operational decisions Develop and own business intelligence dashboards, visualizations, and reports to provide ongoing tracking and insights to the team Build and improve advanced analytical models for product and business use cases Collaborate with data engineer to improve data architecture and maintain a robust and accurate data warehouse Acquire data from primary or secondary data sources and maintain databases/data systems Identify, analyze, and interpret trends or patterns in complex data sets Discover ways to use analytics to support team members across the business to yield action through data-driven decision making Qualifications 2-4 years experience managing data analysis projects. eCommerce or SaaS experience is a plus. Strong analytical skills with the ability to collect, organize, analyze, and disseminate significant amounts of information with attention to detail and accuracy. Excel at composing concise efficient SQL queries, writing reports and presenting findings with data visualization tools. Experience using a cloud data warehouse environment (such as BigQuery) Experience with Python and pandas is a plus. Working knowledge of business statistics and probability. Ability to build trust and communicate insights effectively with a variety of business stakeholders across analytical levels. Desire to be a partner to business stakeholders with a shared goal of using analytics and insights to drive the business forward. Communicator. Excellent communication skills and a willingness to give and receive feedback. Driven. Proactive and self-driven problem-solving with sharp attention to detail. Iterative. You deliver results quickly with iteration, instead of waiting for perfection. Adaptable. You are flexible and versatile with projects, goals, and strategies. You move quickly with change and stay open-minded Entrepreneurial. You are a proven executor and work with urgency to produce excellent results with limited time and resources Lifelong learner. You are actively consuming content (podcasts, blogs, books, etc) and applying these learnings in your work to make sure you are as effective as possible. Passion for Osmosis’s mission to provide your future clinicians the best education so they can provide you and your loved ones the best care. Osmosis is an equal opportunity and affirmative action employer. All qualified applicants will receive consideration for employment without regard to race, color, religion, sex, national origin, disability, protected veteran status or other status protected by law. To apply, please submit the following to careers@osmosis.org : Resume Portfolio of any relevant work Answers to the following questions (50 words or less for each question): What was an interesting data problem you worked on within the last year? How did you identify and address it? Describe a situation where you did not have access to all of the data needed to triage a problem or analyze a situation, and how you adapted to it. Based solely on what you see on osmosis.org, how would you measure customer lifetime value for Osmosis? Incomplete applications will not be considered.'
D2 = "Who We Need: Cardinal Financial understands that great people are the key to great companies. We are looking for intelligent, hard-working, passionate individuals that want to be part of something very different. We need people that dream big and possess a work ethic that will inspire those around them. We are seeking forward thinking people, who produce results rather than wait for them. You will not be micromanaged; but you will need to meet specific expectations and it will be entirely up to you to make sure that this happens. You will be backed by one of the strongest, most supportive and technical mortgage banking leadership teams in the industry and we are all committed to the success of the enterprise. We are currently looking for energetic, hardworking, and knowledgeable Full Stack Software Engineers located on the East Coast and West Coast. What You Will Do: You’ll be involved in every aspect of building and supporting our SaaS enterprise mortgage lending platform. We’re an agile shop and you’ll be part of choosing what stories you’ll work on as they come up in the backlog. You’ll do full-stack development because we’ve found it benefits the team and product when an engineer is familiar with the entire stack and has a genuine interest in all our software technology. We also recognize that each engineer is passionate and skilled in specific layers. We manage to blend the two realities very well. You’ll manage your stories completely including working with end users to determine what is required, designing the UI, classes, business logic and data. We describe our approaches informally to get rapid review and critique by others. You’ll write clean, concise code, and robust unit tests for all your work. Finished code will be reviewed by others in the team. We mix up the review teams so everyone has good exposure to the whole system. You’ll find ways to improve our product and how we work. We leverage tools and innovation to make more happen with less. When we identify an improvement, we implement it fast. You’ll help with production support and help users when needed. What You Are Like: If you think you’d like to work with us, here are some things that should apply to you: You’re comfortable working in a small team. Each of us has a huge impact and we depend on each other to get things done. You love a fast environment with a lot of churn. You’re passionate about good object-oriented design, great UX, security, performance optimization and testing. You pride yourself on understanding projects top to bottom. You enjoy working alone or working with others. You’re comfortable doing things even when you’re not told exactly what to do. You take pleasure in creation, chaos, spontaneity, change, debate and silence. You like helping others become better and more successful. You know how to make life easier for others on your team. You’re OK chipping in on things that have nothing to do with your current project, or helping with off-hour production emergencies and deployments. What You Need: You have a bachelor’s degree in Computer Science or related field and at least two years software development experience on a large-scale web application. Mortgage knowledge and experience is a plus. You can analyze a feature story and design a robust and complete solution for it. You have excellent debugging skills and use tools to aid you. You write well-designed, reliable code that you or others will find easy to understand and modify six months from now. You know Java, databases and SQL very well. You’re comfortable with Linux commands and tools. You’ve implemented UIs using HTML/CSS/Javascript. You’ve got solid JavaScript skills, including object-oriented JavaScript, not just jQuery. Experience with single-page application frameworks like Ember and Angular are a plus. You're comfortable implementing integrations with third-party systems using HTTP and XML. You know and use all of these: IDE, source control, debugger, continuous testing, build automation. You communicate well whether you’re patiently helping a user, explaining a design to your colleagues, or writing a specification. Our Technology: Our SaaS enterprise mortgage lending platform is a challenging and complex system that includes lender and borrower interfaces, workflow, document management, advanced automation, and integrations with external entities and services. The server architecture is stateless, cleanly managing the business logic and persistence layer, exposed as a RESTful JSON API. The server is written using a combination of Java 8 on Jetty, and Node.js for asynchronous tasks. We persist our data in MySQL using MyBatis and use Redis for caching, metrics, and non-critical message queueing. The UI uses a custom, JavaScript MVC framework with many modern techniques: dynamic code loading modules, client-side routing and templates, powerful data-binding features, integrated services, and advanced component architecture. We develop on Macs and deploy on AWS. Our tools include: github, Jenkins, gradle, grunt, JAXB, iText, Aspose, IntelliJ IDEA, Pivotal Tracker. Please apply to the Cardinal Financial website and mention weworkremotely.com as the source when prompted. https://cardinalfinancial.com"
D3 = 'Flexible/remote work friendly environment Greenfield project Technology first company Work with exciting AI & mobile tech Join an experienced tech & product team Ukufu* (pronounced oo - koo - foo) is a new AI powered content aggregation mobile application for professionals. Ukufu version 1.0 is set for a soft-launch in late September. We recently closed a round of seed funding from a couple of smart and supportive investors, and we are excited for the next stage of our journey! Watch a short message from our CEO: https://www.youtube.com/watch?v=ABE_3NQRb5E Our mission is bold: Build an intelligence layer around the 10 000 English news-related content pieces that get published every day. Then use this layer to power an easy-to-use category based content aggregation app that helps professionals efficiently consume content across multiple content sources. We want to enable a content consumption experience that is simple to use, yet comprehensive in depth and breadth of content. We are already 3 months into our journey. You can view a working prototype of our mobile application here: https://www.youtube.com/watch?v=z0Fp2HDH7SU Over the next 6 - 12 months, we will be focussed on stage 1, working closely with users to build something amazing that we can then scale up in stage 2. Our headquarters are in the Sydney CBD but we have team members around the world. This role can be on-site, remote or a mix of both. Our distributed team structures requires all team members to be flexible around time zones. Each role also has minimum daily crossover time requirements. Our remote-friendly work culture and processes have been in place for a couple of years (our team used to work together on a product that reached over 4 million users) and our distributed team structure is working well. All team members are required to ensure there is a We work hard at fostering a focused and friendly workplace, where team members are able to do their best work. We are looking for someone with outstanding technical experience, a mature attitude and a preference for working with a small smart team, to join us in the role of Technical Lead at Ukufu. This role includes hands-on development work as well as mentoring, building out the team when applicable, code reviews and systems architectural design. You will work directly with the CEO as well as the development and product team. Our team of 8 currently consists of 3 engineers (excluding the Tech Lead). We aim to add 4 new engineers (excluding the Tech lead) over the next couple of months. These 7 engineers will fall under your leadership. Our non-engineering team members include a Design Lead and Product Manager who you will work closely with. Our current stack includes Flutter, Python, PHP, Kubernetes and AWS. The Role Strategise with the business and product teams to determine priorities and goals Lead technical discussions and decisions Advocate best practice software engineering principles within the team Drive process in an agile environment Fill the role of a Scrum master, directing various ceremonies, e.g. Planning sessions, retrospectives, Sprint showcases, etc Ensure a constant operational awareness of the platform health and team effectiveness Identify gaps in team capabilities and be involved in the hiring process Analyse data in order to help identify areas for improvement in the product, process and team Mentor the team in both engineering and process-related areas Actively developing the application Assist on occasion with various technical tasks relating to different legacy products Requirements At least 10 years of relevant experience in a software development role. Experience designing and building complex software solutions and related infrastructure Experience building, configuring and maintaining a mobile-related application stack. Strong background in OO development with a proficient understanding of fundamental principles such as TDD, DDD, SOLID, DRY and KISS. Familiarity working with Amazon AWS services (e.g. RDS, DMS, S3, EC2, CloudWatch, CloudSearch, ElasticSearch, etc). Working experience with Linux. Experience with system monitoring tools. Familiarity with popular server software packages (MySQL, PostgreSQL) Mature attitude Experience leading and managing a technical team Excellent written and verbal skills Exceptional attention to detail and the ability to manage multiple high priority projects and tasks Passion for solving complex technical problems Enjoy working in a fast-moving environment Bonus Skills Strong working knowledge of the latest Machine Learning techniques and technologies Mobile application development experience Experience with Dart or Flutter DevOps experience Experience building an online product Has contributed to open source projects (provide examples if available) Comprehensive understanding and experience with system security Relevant University degree Our application process usually includes an initial chat with the CEO, one technical task, then a chat with 2-3 additional team members. To apply for this role, please apply via the Recruitee link only. * Ukufu comes from the Zulu word Ukufunda, which means “to learn”.'


